// HasLogData applies the HasEdge predicate on the "LogData" edge.
func HasLogData() predicate.CategoryMininumMarkMapping {
	return predicate.CategoryMininumMarkMapping(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, LogDataTable, LogDataColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasLogDataWith applies the HasEdge predicate on the "LogData" edge with a given conditions (other predicates).
func HasLogDataWith(preds ...predicate.Logs) predicate.CategoryMininumMarkMapping {
	return predicate.CategoryMininumMarkMapping(func(s *sql.Selector) {
		step := newLogDataStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CategoryMininumMarkMapping) predicate.CategoryMininumMarkMapping {
	return predicate.CategoryMininumMarkMapping(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CategoryMininumMarkMapping) predicate.CategoryMininumMarkMapping {
	return predicate.CategoryMininumMarkMapping(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CategoryMininumMarkMapping) predicate.CategoryMininumMarkMapping {
	return predicate.CategoryMininumMarkMapping(func(s *sql.Selector) {
		p(s.Not())
	})
}
